import Vue from 'vue'
import App from './App.vue'

import VueRouter from 'vue-router'


Vue.use(VueRouter)

Vue.config.productionTip = false



import Home from './view/Home.vue'

const routes = [
	{ path: '/home', component: Home}
]

const router = new VueRouter({
	routes
})



new Vue({
  render: h => h(App),
}).$mount('#app')
